using System;
using System.Collections.Generic;
using System.IO;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using DAS.Model.Model.Product;
using DAS.Model.Model.User;
using OpenCvSharp;
using static System.Net.Mime.MediaTypeNames;

namespace DAS.Console
{
    internal class Program
    {
        static void Main(string[] args)
        {
            var img = "data:image/jpeg;base64,";

            byte[] bytes = Convert.FromBase64String(img.Split(',')[1]);

            Mat src = Cv2.ImDecode(bytes, ImreadModes.Color);
            src= src.Resize(new Size(500, 500));
            System.Console.WriteLine(src.Size());

            using (var window = new Window("window", image: src, flags: WindowMode.AutoSize))
            {
                Cv2.WaitKey();
            }


        }
    }
}
